import React from "react";

// Components Import
import Form from "../Form";
import Table from "../Table";

const Main = props => {
  return (
    <main>
      <Form
        inputs={props.inputs}
        handleInputChange={props.handleInputChange}
        handleSubmit={props.handleSubmit}
        setWeather={props.setWeather}
        weather={weather}
      />
      <Table weather={props.weather}></Table>
    </main>
  );
};

export default Main;
